import React, { useEffect, useState } from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import MenuIcon from '@mui/icons-material/Menu';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import { Search,SearchIcon } from '@mui/material';
import './NavigationBar.css'
const NavigationBar = () => {
  const [isAdmin,setisAdmin]=useState(false);
  const [isLogin,setisLogin]=useState(false);

  useEffect(()=>{
    if(!isAdmin){setisAdmin(localStorage.getItem('isAdmin'))}    
    if(!isLogin){setisLogin(localStorage.getItem('isLogin'))}
  });
  return (
    <div className='header'>
    <AppBar position="static" sx={{bgcolor:"#3f51b5"}}>
            <Toolbar sx={{minHeight:'none'}}>
                <ShoppingCartIcon
                    size="small"
                    edge="start"
                    color="inherit"
                    aria-label="menu"
                    sx={{ mr: 1 }}
                >
                    <MenuIcon />
                </ShoppingCartIcon>
                <Typography variant="h6"
                    component="div" sx={{ flexGrow: 1 }}>
                    upGrad E-Shop
                </Typography>
                <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Searchâ€¦"
              inputProps={{ 'aria-label': 'search' }}
            />
          </Search>
                {isLogin?
                 <Button color="inherit">Login</Button>:
                <Button className='btn' variant="contained" color="inherit" sx={{bgcolor:"#f50057", m:"2"}} >Logout</Button>
              } </Toolbar>
        </AppBar>
        </div>
  );
};

export default NavigationBar;
